import React, { useEffect, useState } from 'react';
import Box from '@mui/material/Box';
import { DataGrid, GridColDef } from '@mui/x-data-grid';
import { MY_BU_ID, BASE_API_URL, GET_DEFAULT_HEADERS } from "../globals";

interface TestProps {
  students: string[];
}

const columns: GridColDef[] = [
  {
    field: 'studentID',
    headerName: 'Student ID'
  },
  {
    field: 'studentName',
    headerName: 'Student Name',
    width: 150
  },
  {
    field: 'classID',
    headerName: 'Class ID'
  },
  {
    field: 'className',
    headerName: 'Class Name'
  },
  {
    field: 'semester',
    headerName: 'Semester'
  },
  {
    field: 'finalGrade',
    headerName: 'Final Grade'
  },

];


export default function Test({ students }) {
  // const [rows, setRows] = useState([{ studentID: "...", studentName: 'Snow', classID: 'Jon', className: 14 ,semester:"...",finalGrade:""}]);
  const [rows, setRows] = useState([]);
  return (
        <Box sx={{ height: 400, width: '100%' }}>
          <DataGrid
            rows={rows}
            columns={columns}
          />
        </Box>
      );
}
